import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';
import './Navbar.css';



const Navbar = () => {
    // const [active, setActive] = useState(false)
    // const handleActive = () => {
    //     setActive(!active)

    // }
    const [isNavExpanded, setIsNavExpanded] = useState(false)
    return (
        <nav className='navigate'>
            <a href='/' className='name'>Name</a>
            <button className="menu-btn" onClick={() => {
                setIsNavExpanded(!isNavExpanded)
            }}>
                {
                    isNavExpanded ? <i class="fa-solid fa-xmark"></i> : <i class="fa-solid fa-bars"></i>
                }
            </button>
            <div className={
                isNavExpanded ? "menu expanded" : "menu"
            }>
                <ul>
                    <li><NavLink href='/' activeClassName='act'><p>Home</p></NavLink></li>
                    <li><NavLink href='/Events' activeClassName='act'><p>Events</p></NavLink></li>
                    <li><NavLink href='/Registration' activeClassName='act'><p>Registration</p></NavLink></li>
                    <li><NavLink href='/login' activeClassName='act'><p>Login</p></NavLink></li>
                </ul>
            </div>
        </nav>
    )
}

export default Navbar
